import React from "react"

class User extends React.Component {
    user = this.props.el
    render() {
        return (
            <div className='user' key={user.id}>
                <h3>{user.firstname} {user.surname}</h3>
                <p>{user.bio}</p>
                <b>{user.isHappy ? "Happy!" : "Not happy :("}</b>
            </div>
        )
    }
}

export default User
